import "./TopBar.css";
const TopBar = () => {
  return (
    <div className="top">
      <div className="top-left">
        <i class="fab fa-facebook" />
        <i class="fab fa-twitter" />
        <i class="fab fa-instagram" />
        <i class="fab fa-linkedin-in" />
      </div>
      <div className="top-center">
        <u className="topList">
          <li className="topList-items">Home</li>
          <li className="topList-items">About</li>
          <li className="topList-items">Pen</li>
          <li className="topList-items">Logout</li>
        </u>
      </div>
      <div className="top-right">
        <img src="https://images.pexels.com/photos/5558237/pexels-photo-5558237.jpeg?cs=srgb&dl=pexels-erik-mclean-5558237.jpg&fm=jpg" alt="ProfileImg" />
      </div>
    </div>
  );
};
export default TopBar;
